
SET FOREIGN_KEY_CHECKS=0;


#
# Structure for the `adm_log` table : 
#

DROP TABLE IF EXISTS `adm_log`;

CREATE TABLE `adm_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `datetime` datetime DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `user_id` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=229 DEFAULT CHARSET=utf8;

#
# Structure for the `adm_user` table : 
#

DROP TABLE IF EXISTS `adm_user`;

CREATE TABLE `adm_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name_first` varchar(128) DEFAULT NULL,
  `password` varchar(128) NOT NULL,
  `email` varchar(128) NOT NULL,
  `name_last` varchar(128) DEFAULT NULL,
  `rating` int(11) DEFAULT '0',
  `time_zone` tinyint(1) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8;

#
# Structure for the `adm_user_role` table : 
#

DROP TABLE IF EXISTS `adm_user_role`;

CREATE TABLE `adm_user_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(128) DEFAULT NULL,
  `code` varchar(128) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8;

#
# Structure for the `adm_user_role_link` table : 
#

DROP TABLE IF EXISTS `adm_user_role_link`;

CREATE TABLE `adm_user_role_link` (
  `user_id` int(11) NOT NULL,
  `role_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Structure for the `cap_chat_messages` table : 
#

DROP TABLE IF EXISTS `cap_chat_messages`;

CREATE TABLE `cap_chat_messages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id_from` int(11) DEFAULT NULL,
  `datetime` int(11) DEFAULT NULL,
  `message` varchar(1000) DEFAULT NULL,
  `user_id_to` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=359 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_design` table : 
#

DROP TABLE IF EXISTS `cap_design`;

CREATE TABLE `cap_design` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `img1` varchar(255) DEFAULT NULL,
  `img2` varchar(255) DEFAULT NULL,
  `img3` varchar(255) DEFAULT NULL,
  `html` text,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_registration` table : 
#

DROP TABLE IF EXISTS `cap_registration`;

CREATE TABLE `cap_registration` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `datetime` int(11) DEFAULT NULL,
  `referal_code` varchar(20) DEFAULT NULL,
  `is_paid` tinyint(4) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_requests` table : 
#

DROP TABLE IF EXISTS `cap_requests`;

CREATE TABLE `cap_requests` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `datetime` int(11) DEFAULT NULL,
  `month` int(11) DEFAULT NULL,
  `hash` varchar(60) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_stock` table : 
#

DROP TABLE IF EXISTS `cap_stock`;

CREATE TABLE `cap_stock` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `logo` varchar(255) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  `finam_em` int(11) DEFAULT NULL,
  `finam_market` int(11) DEFAULT NULL,
  `finam_code` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1401 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_stock_kurs` table : 
#

DROP TABLE IF EXISTS `cap_stock_kurs`;

CREATE TABLE `cap_stock_kurs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_id` int(11) DEFAULT NULL,
  `date` date DEFAULT NULL COMMENT 'Дата по гринвичу 0:00',
  `kurs` float NOT NULL,
  `open` float DEFAULT NULL,
  `high` float DEFAULT NULL,
  `low` float DEFAULT NULL,
  `close` float DEFAULT NULL,
  `volume` float DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `stock_id` (`stock_id`)
) ENGINE=InnoDB AUTO_INCREMENT=2942 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_stock_market` table : 
#

DROP TABLE IF EXISTS `cap_stock_market`;

CREATE TABLE `cap_stock_market` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=520 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_stock_prognosis_blue` table : 
#

DROP TABLE IF EXISTS `cap_stock_prognosis_blue`;

CREATE TABLE `cap_stock_prognosis_blue` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_id` int(11) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `delta` float NOT NULL,
  PRIMARY KEY (`id`),
  KEY `stock_id` (`stock_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1081 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_stock_prognosis_red` table : 
#

DROP TABLE IF EXISTS `cap_stock_prognosis_red`;

CREATE TABLE `cap_stock_prognosis_red` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_id` int(11) DEFAULT NULL,
  `date` date DEFAULT NULL,
  `delta` float NOT NULL,
  PRIMARY KEY (`id`),
  KEY `stock_id` (`stock_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1083 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_user_role` table : 
#

DROP TABLE IF EXISTS `cap_user_role`;

CREATE TABLE `cap_user_role` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(128) DEFAULT NULL,
  `code` varchar(128) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_user_role_link` table : 
#

DROP TABLE IF EXISTS `cap_user_role_link`;

CREATE TABLE `cap_user_role_link` (
  `user_id` int(11) NOT NULL,
  `role_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Structure for the `cap_users` table : 
#

DROP TABLE IF EXISTS `cap_users`;

CREATE TABLE `cap_users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `email` varchar(50) CHARACTER SET latin1 COLLATE latin1_general_ci DEFAULT NULL,
  `password` varchar(60) CHARACTER SET latin1 COLLATE latin1_bin DEFAULT NULL,
  `avatar` varchar(255) CHARACTER SET latin1 COLLATE latin1_bin DEFAULT NULL,
  `datetime_reg` datetime DEFAULT NULL,
  `datetime_activate` datetime DEFAULT NULL,
  `name_first` varchar(50) DEFAULT NULL,
  `name_last` varchar(50) DEFAULT NULL,
  `phone` varchar(20) DEFAULT NULL,
  `is_admin` tinyint(1) DEFAULT NULL,
  `gender` tinyint(1) DEFAULT NULL,
  `date_insert` datetime DEFAULT NULL,
  `date_update` datetime DEFAULT NULL,
  `is_active` tinyint(1) NOT NULL,
  `is_confirm` tinyint(1) NOT NULL,
  `vk_id` int(11) DEFAULT NULL,
  `vk_link` varchar(100) CHARACTER SET ascii COLLATE ascii_bin DEFAULT NULL,
  `fb_id` varchar(30) DEFAULT NULL,
  `fb_link` varchar(100) CHARACTER SET ascii COLLATE ascii_bin DEFAULT NULL,
  `birth_date` date DEFAULT NULL,
  `subscribe_is_news` tinyint(1) DEFAULT NULL,
  `subscribe_is_site_update` tinyint(1) DEFAULT NULL,
  `subscribe_is_manual` tinyint(1) DEFAULT NULL,
  `name_org` varchar(255) DEFAULT NULL,
  `referal_code` varchar(20) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=25 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_users_email_change` table : 
#

DROP TABLE IF EXISTS `cap_users_email_change`;

CREATE TABLE `cap_users_email_change` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `email` varchar(50) DEFAULT NULL,
  `code` varchar(60) DEFAULT NULL,
  `date_finish` int(11) DEFAULT NULL,
  `parent_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_users_recover` table : 
#

DROP TABLE IF EXISTS `cap_users_recover`;

CREATE TABLE `cap_users_recover` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT NULL,
  `code` varchar(60) DEFAULT NULL,
  `date_finish` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 PACK_KEYS=0;

#
# Structure for the `cap_users_registration` table : 
#

DROP TABLE IF EXISTS `cap_users_registration`;

CREATE TABLE `cap_users_registration` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(60) DEFAULT NULL,
  `date_finish` datetime DEFAULT NULL,
  `parent_id` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_users_stock_buy` table : 
#

DROP TABLE IF EXISTS `cap_users_stock_buy`;

CREATE TABLE `cap_users_stock_buy` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stock_id` int(11) DEFAULT NULL,
  `user_id` int(11) DEFAULT NULL,
  `date_finish` date DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8;

#
# Structure for the `cap_users_wallet_history` table : 
#

DROP TABLE IF EXISTS `cap_users_wallet_history`;

CREATE TABLE `cap_users_wallet_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `datetime` int(11) DEFAULT NULL,
  `description` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8;

#
# Structure for the `log` table : 
#

DROP TABLE IF EXISTS `log`;

CREATE TABLE `log` (
  `id` bigint(20) NOT NULL,
  `level` int(11) DEFAULT NULL,
  `category` varchar(255) DEFAULT NULL,
  `log_time` double DEFAULT NULL,
  `prefix` text,
  `message` text
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

#
# Structure for the `migration` table : 
#

DROP TABLE IF EXISTS `migration`;

CREATE TABLE `migration` (
  `version` varchar(180) NOT NULL,
  `apply_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`version`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

